import React from 'react';
import Filters from './Filters';
import CharacterList from './CharacterList';
import PropTypes from 'prop-types';


const Home = props => {
    const {getQuery, data, query} = props;
    return (
        <React.Fragment>
            <Filters getQuery={getQuery}/>
            <CharacterList 
            data={data}
            query={query}/>
        </React.Fragment>
    );
};


export default Home;
